import React from 'react';
import ReactDOM from 'react-dom';
import './Footer.css';

class SocialMedia extends React.Component {
  render() {
    return (
      <div id="FOOTER" class="container-fluid mt-5">
        <ul id="mediaBar" class="nav justify-content-center">
          <li id="mail" class="nav-item media">
            <a class="nav-link" href="#"><i class="fab fa-twitter"></i></a>
          </li>
          <li id="insta" class="nav-item media">
            <a class="nav-link" href="#"><i class="fab fa-whatsapp"></i></a>
          </li>
          <li id="whats" class="nav-item media">
            <a class="nav-link" href="#"><i class="fab fa-instagram"></i></a>
          </li>
          <li id="facebook" class="nav-item media">
            <a class="nav-link" href="#"><i class="fab fa-facebook-f"></i></a>
          </li>
        </ul>
      </div>
    );
  }
}

export default SocialMedia;
